import { Button } from 'semantic-ui-react'



export default function App() {
  return (
    <div>
      <h1>hola</h1>
      <Button secondary>Primary</Button>
    </div>,
    <div><button class="ui primary button">Primary</button><button class="ui secondary button">Secondary</button></div>

  )
}
